import React from 'react'
import {Link,NavLink} from 'react-router-dom'
var actCSS= require('./act.css')

export default class ActPage extends React.Component{
    render(){
        return(
            <div className={actCSS.header}>
           <div className={actCSS.headerys}>
               天天影视
           </div>
            </div>
        )
    }
}
